import styled from 'styled-components';
import image from './profile.png';

const LogoStyle = styled.img`
    background-image: url(${image});
    width: 320px;
    height: 320px;
`;

const Logo = () => {
  return (
    <div className="flex flex-initial w-80 h-80 self-end justify-end justify-items-end justify-self-end ml-auto">
      <LogoStyle />
    </div>

  );
}

export default Logo;
